func addArrayItem(jsonName string) templ.ComponentScript {
	return templ.ComponentScript{
		Name: `__templ_addArrayItem_932e`,
		Function: `function __templ_addArrayItem_932e(jsonName){var containerId = jsonName + '-container';
	var templateId = jsonName + '-template';
	var container = document.getElementById(containerId);
	var template = document.getElementById(templateId);
	var nextIndex = parseInt(container.getAttribute('data-next-index')) || 0;

	var clone = template.content.cloneNode(true);
	var card = clone.querySelector('.array-item-card');

	card.setAttribute('data-item-index', nextIndex);
	card.querySelectorAll('input, select, textarea').forEach(function(el) {
		var name = el.getAttribute('name');
		if (name) {
			el.setAttribute('name', name.replace('[-1]', '[' + nextIndex + ']'));
		}
		var id = el.getAttribute('id');
		if (id) {
			el.setAttribute('id', id.replace(/_-1_/g, '_' + nextIndex + '_'));
		}
	});
	card.querySelectorAll('label[for]').forEach(function(label) {
		var forAttr = label.getAttribute('for');
		if (forAttr) {
			label.setAttribute('for', forAttr.replace(/_-1_/g, '_' + nextIndex + '_'));
		}
	});

	// Wire up the first text input (name field) to update the card header in real-time
	var nameInput = card.querySelector('.item-field');
	if (nameInput) {
		var nameDisplay = card.querySelector('.item-name-display');
		var itemLabel = nameDisplay ? nameDisplay.textContent.replace('New ', '') : '';
		nameInput.addEventListener('input', function() {
			if (nameDisplay) {
				nameDisplay.textContent = this.value || ('New ' + itemLabel);
			}
		});
	}

	container.appendChild(clone);
	container.setAttribute('data-next-index', nextIndex + 1);

	var firstInput = container.lastElementChild.querySelector('input, select, textarea');
	if (firstInput) {
		firstInput.focus();
	}
}`,
		Call:       templ.SafeScript(`__templ_addArrayItem_932e`, jsonName),
		CallInline: templ.SafeScriptInline(`__templ_addArrayItem_932e`, jsonName),
	}
}

